import { emailData } from "../../Data/Data";

const EmailContent = () => {
  return (
    <div>
      <h1>Emails</h1>
      <div className="email-content-list">
        {emailData.map((email) => (
          <div key={email.id} className="email-content-item">
            <a>{email?.display}</a>
          </div>
        ))}
      </div>
    </div>
  );
};
export default EmailContent;
